/* Additional functions */
uint32_t bench_speed() {
  /* Inputs */
  DATATYPE state__[3][4] = { 0 };

  /* Preventing inputs from being optimized out */
  asm volatile("" : "+m" (state__));

  /* Outputs */
  DATATYPE stateR__[3][4] = { 0 };
  /* Primitive call */
  gimli__(state__,stateR__);

  for (int i = 0; i < 3; i++) {
    for (int j = 0; j < 4; j++) {
      uint32_t *tmp = (uint32_t*) &stateR__[i][j];
      printf("%08x ", tmp[0]);
    }
    printf("\n");
  }

  /* Preventing outputs from being optimized out */
  asm volatile("" : "+m" (stateR__));

  /* Returning the number of encrypted bytes */
  return 192;
}

